export default function App(){

  const [data, SetData] = useState('colombia')

  const colom = "colombia";
  const options = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify(colom)
};
  console.log(colom)
  useEffect(()=> {

    fetch("http://localhost:5000/members/colombia").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)
          console.log(Object.values(data));

        }
    )
  }, [])



